INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (8250, 5, 'Para o processo de BOOT seguir o documento BR_VAAP14');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (8250, 6, 'É obrigatório o uso de luvas para TODOS os postos de trabalho verificar VAAP13');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (8250, 7, 'Atenção!! Se a máquina em processo estiver com a TAG 2 (formulário BR_FOQA666) a TAG deve ser mantida junto ao cartão de transporte para seguir com a máquina');
