INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (10314, 1, '.0) Objetivo -Garantir o funcionamento da placa.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (10314, 2, 'É de responsabilidade do operador do posto informar ao Suporte de linha qualquer anomalia de processo (situação fora do normal) durante a realização das tarefas estipuladas para seu posto de trabalho.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (10314, 3, 'As fotos e os videos são ilustrativos apenas para orientação do operador que deve seguir o que esta descrito como operação a ser feita.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (10314, 4, 'ATENÇÃO!!!! Para o posto de FT a descrição das operações na MI é para referência quanto a execução de CADA teste; os Testes que devem ser aplicados e a sequencia de execução sera indicada pelo sistema ITPM.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (10314, 5, 'Uso obrigatório de luvas ESD e ou pulseira ESD.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (10314, 6, 'Manusear cuidadosamente a placa afim de evitar danos.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (10314, 7, 'Nenhuma operação deve ser feita se permanecer dúvidas, neste caso chamar suporte de linha para esclarecimentos.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (10314, 8, 'Caso detectar falha após confirmação do teste durante o processo de FT o colaborador do posto deve descrever o sintoma no Cartão de Transporte da referida placa e encaminhar a mesma juntamente com o Cartão de Transporte para o posto de Debug.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (10314, 9, 'Preencher diariamente no inicio do turno o formulário BR_FOTE058.');
