INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (10698, 1, 'Caso detectar falha após confirmação do teste durante o processo de RSO o colaborador do posto deve descrever o sintoma na TAG da referida placa e encaminhar a mesma juntamente com a TAG para o posto de reparo. Também é de responsabilidade do operador do posto informar ao Suporte de linha qualquer anomalia de processo (situação fora do normal) durante a realização das tarefas estipuladas para seu posto de trabalho, neste caso o Suporte de linha deve analisar ou encaminhar para análise a situação observada e se houver a necessidade de parar a linha seguir o procedimento BR_PRAP007 - Parada de linha. Para maiores informações por favor checar o procedimento BR_PRQA007 - Tratamento de não conformidades.');
