INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (12111, 3, 'As Fotos e os Videos são ilustrativos apenas para orientação do operador que deve seguir o que esta descrito como operação a ser feita.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (12111, 4, 'Nenhuma operação deve ser feita se permanecer dúvidas, neste caso chamar suporte de linha para esclarecimentos.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (12111, 5, 'Para o processo de BOOT seguir o documento BR_VAAP14');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (12111, 6, 'É obrigatório o uso de luvas para TODOS os postos de trabalho verificar VAAP13');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (12111, 7, 'Atenção!! Se a máquina em processo estiver com a TAG 2 (formulário BR_FOQA666) a TAG deve ser mantida junto ao cartão de transporte para seguir com a máquina.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (12111, 8, 'Os documentos de referencia (VAs, QAs FOs) mencionados nas instruções, estão disponíveis no posto de trabalho ou no posto de consulta junto a linha CELL E.');
