INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (13780, 1, 'Caso detectar falha após confirmação do teste durante o processo de AFT o colaborador do posto deve descrever o sintoma no Cartão de Transporte da referida máquina e encaminhar a mesma juntamente com o Cartão de Transporte para o posto de reparo. Também é de responsabilidade do operador do posto informar ao Suporte de linha qualquer anomalia de processo (situação fora do normal) durante a realização das tarefas estipuladas para seu posto de trabalho, neste caso o Suporte de linha deve analisar ou encaminhar para análise a situação observada e se houver a necessidade de parar a linha seguir o procedimento BR_PRAP007 - Parada de linha. Para maiores informações por favor checar o procedimento BR_PRQA007 - Tratamento de não conformidades.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (13780, 2, 'Todas máquinas da área RSO só podem apresentar 2 status: 1- LCD semi-aberto para indicar que o teste está em processo; 2 - LCD fechado indica que o processo de teste está concluído (PASS) e a máquina está pronta para ser removida do rack,');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (13780, 3, 'As Fotos e os Videos são ilustrativos apenas para orientação do operador que deve seguir o que esta descrito como operação a ser feita.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (13780, 4, 'Nenhuma operação deve ser feita se permanecer dúvidas, neste caso chamar suporte de linha para esclarecimentos.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (13780, 5, 'Para o processo de BOOT seguir o documento BR_VAAP14');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (13780, 6, 'É obrigatório o uso de luvas para TODOS os postos de trabalho verificar VAAP13');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (13780, 7, 'Atenção!! Se a máquina em processo estiver com a TAG 2 (formulário BR_FOQA666) a TAG deve ser mantida junto ao cartão de transporte para seguir com a máquina.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (13780, 8, 'Os documentos de referencia (VAs, QAs FOs) mencionados nas instruções, estão disponíveis no posto de trabalho ou no posto de consulta junto a linha CELL E.');
