INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (13943, 1, 'É de responsabilidade do operador do posto informar ao Suporte de linha qualquer anomalia de processo (situação fora do normal) durante a realização das tarefas estipuladas para seu posto de trabalho o Suporte de linha deve analisar ou encaminhar para análise a situação observada e se houver a necessidade de parar a linha seguir o procedimento BR_PRAP07 - Parada de linha. Para maiores informações por favor checar o procedimento BR_PRQA07 - Tratamento de não conformidades.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (13943, 2, 'Se por qualquer motivo as operações definidas para o posto não puderem ser concluídas, o computador deve ser colocado fora da linha, identificado e o responsável pela linha notificado imediatamente.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (13943, 3, 'O formulario Pull List é atualizado pelo setor de PMC a cada MO e pode ser encontrada com os materialistas.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (13943, 4, 'É obrigatório o uso de luvas para TODOS os postos de trabalho verificar VAAP13.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (13943, 5, 'As Fotos e os Videos são ilustrativos apenas para orientação do operador que deve seguir o que esta descrito como operação a ser feita.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (13943, 6, 'Nenhuma operação deve ser feita se permanecer dúvidas, neste caso chamar suporte de linha para esclarecimentos.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (13943, 7, 'O uso da "Peneirinha" é facultativo nos postos de trabalho, quando estiver utilizando a ferramenta em postos de trabalho onde ocorra manuseio da MB a mesma NÃO pode ser apoiada sobre a MB.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (13943, 8, 'As marcações com caneta, para evidenciar as verificações e integridade de conexões ou materiais, "PODEM" ser feitas ao final das operações descritas para o posto.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (13943, 9, 'Os documentos de referencia (VAs, QAs FOs) mencionados nas instruções, estão disponíveis no posto de trabalho ou no posto de consulta junto a linha CELL E.');
