INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (14573, 8, 'Atenção!! Se a máquina em processo estiver com a TAG 2 (formulário BR_FOQA666) a TAG deve ser mantida junto ao cartão de transporte para seguir com a máquina.');
