INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (15326, 1, 'Caso detectar falha após confirmação do teste durante o processo de AFT o colaborador do posto deve descrever o sintoma no Cartão de Transporte da referida máquina e encaminhar a mesma juntamente com o Cartão de Transporte para o posto de reparo. Também é de responsabilidade do operador do posto informar ao Suporte de linha qualquer anomalia de processo (situação fora do normal) durante a realização das tarefas estipuladas para seu posto de trabalho, neste caso o Suporte de linha deve analisar ou encaminhar para análise a situação observada e se houver a necessidade de parar a linha seguir o procedimento BR_PRQA009 - Parada de linha Notebook (AP). Para maiores informações por favor checar o procedimento BR_PRQA007 - Tratamento de não conformidades.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (15326, 2, 'Todas máquinas da área RSO só podem apresentar 2 status: 1- LCD semi-aberto para indicar que o teste está em processo; 2 - LCD fechado indica que o processo de teste está concluído (PASS) e a máquina está pronta para ser removida do rack');
