INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (15436, 1, 'É de responsabilidade do operador do posto informar ao Suporte de linha qualquer anomalia de processo (situação fora do normal) durante a realização das tarefas estipuladas para seu posto de trabalho o Suporte de linha deve analisar ou encaminhar para análise a situação observada e se houver a necessidade de parar a linha seguir o procedimento BR_PRQA09 - Parada de linha. Para maiores informações por favor checar o procedimento BR_PRQA07 - Tratamento de não conformidades.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (15436, 2, 'Se por qualquer motivo as operações definidas para o posto não puderem ser concluídas, o computador deve ser colocado fora da linha, identificado e o responsável pela linha notificado imediatamente.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (15436, 3, 'O formulario Pull List é atualizado pelo setor de PMC a cada MO e pode ser encontrada com os materialistas.');
