INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (15436, 6, 'Nenhuma operação deve ser feita se permanecer dúvidas, neste caso chamar suporte de linha para esclarecimentos.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (15436, 7, 'O uso da "Peneirinha" é facultativo nos postos de trabalho, quando estiver utilizando a ferramenta em postos de trabalho onde ocorra manuseio da MB a mesma NÃO pode ser apoiada sobre a MB.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (15436, 8, 'As marcações com caneta, para evidenciar as verificações e integridade de conexões ou materiais, "PODEM" ser feitas ao final das operações descritas para o posto.');
