INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17145, 1, 'Objetivo - Montagem de caixas para envio de placas.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17145, 2, 'É de responsabilidade do operador do posto informar ao Suporte de linha qualquer anomalia de processo (situação fora do normal) durante a realização das tarefas estipuladas para seu posto de trabalho.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17145, 3, 'As fotos e os vídeos são ilustrativos apenas para orientação do operador que deve seguir o que esta descrito como operação a ser feita.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17145, 4, 'O PN do material pode ser confirmado na lista de materiais estipulado para a ordem (Pull List), qualquer dúvida, deve ser esclarecida com o suporte de linha.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17145, 5, 'Nenhuma operação deve ser feita se permanecer dúvidas, neste caso chamar suporte de linha para esclarecimentos.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17146, 1, 'É de responsabilidade do operador do posto informar qualquer anomalia de processo (situação fora do normal) durante a realização das tarefas estipuladas para seu posto de trabalho.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17146, 2, 'Se por qualquer motivo as operações definidas para o posto não puderem ser concluídas, o suporte de linha (Universal, Liderança, Engenharia ou Qualidade) deve ser acionado.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17146, 3, 'O suporte de linha deve analisar ou encaminhar para análise a situação observada e se houver a necessidade de parar a linha seguir o procedimento BR_PRQA072 - Parada de linha – SMT - Guideline. - - Para maiores informações por favor checar o procedimento BR_PRQA07 - Tratamento de não conformidades.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17146, 4, 'As fotos e os vídeos são ilustrativos apenas para orientação do operador que deve seguir o que esta descrito como operação a ser feita.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17146, 5, 'Nenhuma operação deve ser feita se permanecer dúvidas, neste caso chamar suporte para esclarecimentos.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17147, 1, 'Utilizar as proteções anti-estáticas necessárias e luvas para proteção de temperatura.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17147, 2, 'A temperatura do ferro de solda utilizado no retrabalho de BGA é de 380°C+/- 05°C (Para o equipamento PACE) e 400°C+/- 10°C (Para equipamento QUICK)');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17147, 3, 'Verificar a data de validade do Fluxo, toda vez que for utilizar. Caso seja necessário colocar em outro recipiente, que não seja a embalagem original, deverá ser descartado no final de cada turno.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17147, 4, 'Para manuseio e manutenção preventiva do equipamento seguir o processo de acordo com o documento BR_VATS040 "');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17147, 5, 'Após a finalização de todo o reparo, realizar o processo de limpeza e remoção do fluxo com cleaner.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17147, 6, 'Utilizar pincel anti-estático de cerdas firmes e pano ESD, que deverá ser trocado a cada limpeza. O pincel anti-estático também deverá ser limpo com cleaner.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17147, 7, 'Após 2 trocas ou 5 aquecimentos na mesma placa com o resultado negativo, deve-se rejeitar a MB.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17147, 8, 'Ao manusear produtos químicos observar as informações contidas nas referidas FISPQ''''s (Ficha de Informação de segurança de produto químico) afixadas no setor. "');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17147, 9, 'O Controle de troca de BGA será feito pelo programa SI2. Portando antes da remoção ou inserção do BGA a placa deverá ser logada no programa através do celular.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17147, 10, 'Em caso de instabilidade comprovada de qualquer equipamento de temperatura controlada, acionar o engenheiro responsável que fará a analise e realizar as medições de hora em hora no formulário BR_FOTS103 - Verificação de temperatura de equipamento para validação de estabilidade. A engenharia definirá por quanto tempo deverá ser feito os registros para garantir que o equipamento esta apto para uso. Os formulário preenchidos deverão ser armazenados no período de 1 ano.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17147, 11, 'Imagens meramente ilustrativas.');
