INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17360, 1, 'Informar qualquer anomalia de processo (situação fora do normal) durante a realização das tarefas.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17360, 2, 'Analisar ou encaminhar para análise a situação observada fora das especificações pré estabelecidas e se houver a necessidade de parar a linha seguir o procedimento BR_PRQA072 - Parada de linha – SMT - Guideline. - - Para maiores informações, por favor, checar o procedimento BR_PRQA07 - Tratamento de não conformidades.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17360, 3, 'Fotos e vídeos deste documento são ilustrativos, dúvidas procurar Engenharia.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17361, 1, 'É de responsabilidade do operador do posto informar qualquer anomalia de processo (situação fora do normal) durante a realização das tarefas estipuladas para seu posto de trabalho.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17361, 2, 'Se por qualquer motivo as operações definidas para o posto não puderem ser concluídas, o suporte de linha (Universal, Liderança, Engenharia ou Qualidade) deve ser acionado.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17361, 3, 'O suporte de linha deve analisar ou encaminhar para análise a situação observada e se houver a necessidade de parar a linha seguir o procedimento BR_PRQA072 - Parada de linha – SMT - Guideline. - - Para maiores informações por favor checar o procedimento BR_PRQA07 - Tratamento de não conformidades.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17361, 4, 'As fotos e os vídeos são ilustrativos apenas para orientação do operador que deve seguir o que esta descrito como operação a ser feita.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17361, 5, 'Nenhuma operação deve ser feita se permanecer dúvidas, neste caso chamar suporte para esclarecimentos..');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17362, 1, 'Para consultar as notas verificar a primeira operação do posto de trabalho');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17363, 1, 'Para consultar as notas verificar a primeira operação do posto de trabalho.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17365, 1, 'É de responsabilidade do operador do posto informar ao Suporte de linha qualquer anomalia de processo (situação fora do normal) durante a realização das tarefas estipuladas para seu posto de trabalho o Suporte de linha deve analisar ou encaminhar para análise a situação observada; se houver a necessidade de parar a linha seguir o procedimento BR_PRQA072 - Parada de linha – SMT - Guideline. Para mais informações, por favor, checar o procedimento BR_PRQA07 - Tratamento de não conformidades');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17365, 2, 'Fotos e vídeos deste documento são ilustrativos, dúvidas procurar Engenharia.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17365, 3, 'Outras observações estão detalhados abaixo neste documento.');
