INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17372, 1, 'Para consultar as notas verificar a primeira operação do posto de trabalho.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17373, 1, 'Para consultar as notas verificar a primeira operação do posto de trabalho.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17383, 1, '.0) Objetivo - Adequação e reparo para versão de revisão corrente da MB.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17383, 2, 'É de responsabilidade do operador do posto informar ao Suporte de linha qualquer anomalia de processo (situação fora do normal) durante a realização das tarefas estipuladas para seu posto de trabalho.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17383, 3, 'As fotos e os vídeos são ilustrativos apenas para orientação do operador que deve seguir o que esta descrito como operação a ser feita.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17383, 4, 'Uso obrigatório de luvas ESD e ou pulseira ESD.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17383, 5, 'Manusear cuidadosamente a placa a fim de evitar danos.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17383, 6, 'Nenhuma operação deve ser feita se permanecer dúvidas, neste caso chamar suporte de linha para esclarecimentos. ATENÇÃO!! - As operações nº 01, 02, 03, 04 e 05 são aplicáveis apenas no inicio de processo no posto.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17384, 1, 'Para consultar as notas verificar a primeira operação do posto de trabalho.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17402, 1, 'Utilizar as proteções anti-estáticas necessárias e luvas para proteção de temperatura.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17402, 2, 'A temperatura do ferro de solda utilizado no retrabalho de BGA é de 380°C+/- 05°C (Para o equipamento PACE) e 400°C+/- 10°C (Para equipamento QUICK)');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17402, 3, 'Verificar a data de validade do Fluxo, toda vez que for utilizar. Caso seja necessário colocar em outro recipiente, que não seja a embalagem original, deverá ser descartado no final de cada turno.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17402, 4, 'Para manuseio e manutenção preventiva do equipamento seguir o processo de acordo com o documento BR_VATS040 "');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17402, 5, 'Após a finalização de todo o reparo, realizar o processo de limpeza e remoção do fluxo com cleaner.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17402, 6, 'Utilizar pincel anti-estático de cerdas firmes e pano ESD, que deverá ser trocado a cada limpeza. O pincel anti-estático também deverá ser limpo com cleaner.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17402, 7, 'Após 2 trocas ou 5 aquecimentos na mesma placa com o resultado negativo, deve-se rejeitar a MB.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17402, 8, 'Ao manusear produtos químicos observar as informações contidas nas referidas FISPQ''''s (Ficha de Informação de segurança de produto químico) afixadas no setor. "');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17402, 9, 'O Controle de troca de BGA será feito pelo programa SI2. Portando antes da remoção ou inserção do BGA a placa deverá ser logada no programa através do celular.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17402, 10, 'Em caso de instabilidade comprovada de qualquer equipamento de temperatura controlada, acionar o engenheiro responsável que fará a analise e realizar as medições de hora em hora no formulário BR_FOTS103 - Verificação de temperatura de equipamento para validação de estabilidade. A engenharia definirá por quanto tempo deverá ser feito os registros para garantir que o equipamento esta apto para uso. Os formulário preenchidos deverão ser armazenados no período de 1 ano.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17402, 11, 'Imagens meramente ilustrativas.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17403, 1, 'Para consultar as notas verificar a primeira operação do posto de trabalho.');
