INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17475, 1, 'Utilizar as proteções anti-estáticas necessárias e luvas para proteção de temperatura.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17475, 2, 'A temperatura do ferro de solda utilizado no retrabalho de BGA é de 380°C+/- 05°C (Para o equipamento PACE) e 400°C+/- 10°C (Para equipamento QUICK)');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17475, 3, 'Verificar a data de validade do Fluxo, toda vez que for utilizar. Caso seja necessário colocar em outro recipiente, que não seja a embalagem original, deverá ser descartado no final de cada turno.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17475, 4, 'Para manuseio e manutenção preventiva do equipamento seguir o processo de acordo com o documento BR_VATS040 "');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17475, 5, 'Após a finalização de todo o reparo, realizar o processo de limpeza e remoção do fluxo com cleaner.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17475, 6, 'Utilizar pincel anti-estático de cerdas firmes e pano ESD, que deverá ser trocado a cada limpeza. O pincel anti-estático também deverá ser limpo com cleaner.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17475, 7, 'Após 1 trocas ou 2 aquecimentos na mesma placa com o resultado negativo, deve-se rejeitar a MB.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17475, 8, 'Ao manusear produtos químicos observar as informações contidas nas referidas FISPQ''''s (Ficha de Informação de segurança de produto químico) afixadas no setor. "');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17475, 9, 'O Controle de troca de BGA será feito pelo programa SI2. Portando antes da remoção ou inserção do BGA a placa deverá ser logada no programa através do celular.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17475, 10, 'Em caso de instabilidade comprovada de qualquer equipamento de temperatura controlada, acionar o engenheiro responsável que fará a analise e realizar as medições de hora em hora no formulário BR_FOTS103 - Verificação de temperatura de equipamento para validação de estabilidade. A engenharia definirá por quanto tempo deverá ser feito os registros para garantir que o equipamento esta apto para uso. Os formulário preenchidos deverão ser armazenados no período de 1 ano.');
INSERT INTO TMI.NSF_MI_MI_NOTE(MI_ID, SEQUENCE, NOTE) VALUES (17475, 11, 'Imagens meramente ilustrativas.');
